import React, {useState, useEffect} from 'react';
import '..//Styles/Chart.css';
import { AiFillStar } from "react-icons/ai";


function Chart (){
    return(
        <div className="chartFlexContainer">
           <div>
               <img src="https://encrypted-tbn3.gstatic.com/images?q=tbn:ANd9GcRlIHtgWeQQsiZaY5iw_A5FTDeKr7bNFWo1W_zObm0h_ti2Yk0V" alt="" />
           </div>
           <div>
               <h1>1. Casablanca</h1><h2>1975</h2>
               <span>R</span><span className="verticalLine"></span>
               <span>142 min</span><span className="verticalLine"></span>
               <span>Drama</span>
               <span>9.3</span><AiFillStar className="starIcon"/>
               <p>Two imprisoned men bond over a number of years, finding solace and eventual redemption through acts of common decency.</p>
               <span>Director: Frank Darabont</span><span className="verticalLine"></span><span>Stars</span><span className="verticalLine"></span>
               <span> Tim Robbins, Morgan Freeman, Bob Gunton, William Sadler</span>
           </div>
        </div>
    )
}

export default Chart;
